import React, {useEffect, useState} from "react";
import "../../../css/header.css"

export default function Cost_calculation() {
    const [costCalculation, setCostCalculations] = useState([]);

    const getCostCalculation = () => {
        fetch("/get")
            .then(orders => orders.json())
            .then(orders => setCostCalculations(orders))
    }

    useEffect(() =>{
        getCostCalculation()
    })

    return (
        <>
            <div className="order">
                <table>
                    <tr>
                        <th>NAME</th>
                        <th>PHONE</th>
                        <th>DELETED</th>
                    </tr>
                    {
                        costCalculation.map((o) => (
                            <tr>
                                <td key={o.name}>{o.name}</td>
                                <td key={o.numberPhone}>{o.numberPhone}</td>
                                <td>
                                    <button onClick={() => {
                                        
                                    }}>Delete</button>
                                </td>
                            </tr>
                        ))
                    }
                </table>
            </div>
        </>
    )
}
